  false,\n\t\"url\": null,\n\t\"notes\": \"The Service Water and Impoundment Monitoring
  (SWIM1) database was developed for the purpose of managing water level and water
  quality (salinity) data for areas managed by the U.S. Fish and Wildlife Service
  (USFWS). There are two versions of SWIM.  The SWIM1 database is a Microsoft Access
  relational database intended for use by field stations who are not managing their
  locational data using ArcGIS.   If you desire to manage your locations using ArcGIS,
  please download SWIM2.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
